import React from 'react'
import './PrimaryButton.css'

function PrimaryButton({value, isBlack}) {
  return (
    <div className={ 'primary-button--container' + isBlack?' dark-mode':'' }>
      <button className='primary-button'>{value}</button>
      <div className='outline'></div>
    </div>
  )
}

export default PrimaryButton
